import React, { useState, useEffect } from 'react';
import axios from 'axios';

const CreatePackage = () => {
  const [couriers, setCouriers] = useState([]);
  const [selectedCourier, setSelectedCourier] = useState("");
  const [deliveryAddress, setDeliveryAddress] = useState("");
  const [payOnDelivery, setPayOnDelivery] = useState(false);
  const [status, setStatus] = useState("NEW");

  useEffect(() => {
    const fetchCouriers = async () => {
      try {
        const response = await axios.get('http://localhost:8081/get-courier');
        setCouriers(response.data);
      } catch (error) {
        console.error('Error fetching couriers:', error);
      }
    };

    fetchCouriers();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const newPackage = {
      courier: { id: selectedCourier },
      deliveryAddress,
      payOnDelivery,
      status,
    };

    try {
      await axios.post('http://localhost:8081/package/create-package', newPackage);
      alert('Package created successfully!');
      setSelectedCourier("");
      setDeliveryAddress("");
      setPayOnDelivery(false);
      setStatus("NEW");
    } catch (error) {
      console.error('Error creating package:', error);
      alert('Failed to create package.');
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Create Package</h1>
      <form onSubmit={handleSubmit} style={styles.form}>
        <label style={styles.label}>Courier:</label>
        <select
          value={selectedCourier || ""}
          onChange={(e) => setSelectedCourier(e.target.value)}
          style={styles.select}
        >
          <option value="">Select a Courier</option>
          {couriers.map((courier) => (
            <option key={courier.id} value={courier.id}>
              {courier.name}
            </option>
          ))}
        </select>

        <label style={styles.label}>Delivery Address:</label>
        <input
          type="text"
          value={deliveryAddress}
          onChange={(e) => setDeliveryAddress(e.target.value)}
          style={styles.input}
        />

        <label style={styles.label}>
          <input
            type="checkbox"
            checked={payOnDelivery}
            onChange={(e) => setPayOnDelivery(e.target.checked)}
            style={styles.checkbox}
          />
          Pay on Delivery
        </label>

        <label style={styles.label}>Status:</label>
        <select
          value={status}
          onChange={(e) => setStatus(e.target.value)}
          style={styles.select}
        >
          <option value="NEW">NEW</option>
          <option value="PENDING">PENDING</option>
          <option value="DELIVERED">DELIVERED</option>
        </select>

        <button type="submit" style={styles.button}>
          Create Package
        </button>
      </form>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '600px',
    margin: '50px auto',
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '10px',
    backgroundColor: '#f5e9e5', // Bej deschis
  },
  title: {
    textAlign: 'center',
    color: '#d4849a', // Roz deschis
    marginBottom: '20px',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
  },
  label: {
    marginBottom: '10px',
    color: '#6e6e6e', // Gri
    fontWeight: 'bold',
  },
  select: {
    marginBottom: '20px',
    padding: '10px',
    border: '1px solid #d4849a', // Roz pentru accent
    borderRadius: '5px',
    backgroundColor: '#fff',
  },
  input: {
    marginBottom: '20px',
    padding: '10px',
    border: '1px solid #d4849a', // Roz pentru accent
    borderRadius: '5px',
    backgroundColor: '#fff',
  },
  checkbox: {
    marginRight: '10px',
  },
  button: {
    padding: '10px',
    backgroundColor: '#d4849a', // Roz pentru butoane
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontWeight: 'bold',
  },
};

export default CreatePackage;
